import React from 'react';


const UserInput = (props) => {
    const inputStyle = {
        border: '2px solid red'  };

    return (
        <div>
            
            <input 
                type="text" 
                style={inputStyle}
                onChange={props.changed} 
                value={props.currentName} />;

        </div>
    );
};

export default UserInput ;
